import React from 'react';
import pc from './MyPosts.module.css'
const MyPosts = () => {
    return (

        <div>
            My posts
            <div>
                <textarea> </textarea>
                <button> add post </button>
            </div>
            <div>
                <img className={pc.img} src='https://static.wallpapers-anime.com/upload/20170506/148/o/q/y/oqyDEF.png'/>
                <div className={pc.item}>
                    post1
                </div>
                <div className={pc.item}>
                    post2
                </div>
            </div>
        </div>
);
}
export default MyPosts;
